import React from 'react';
import Logo from '../Logo/Logo';
import {
	NavContainer,
	Nav,
	SubNavMenu,
	SubNavMenuList,
	SubNavMenuListItem
} from '../../components/Navigation/Style';
import { BodyContainer } from '../StyledComponents/StyledComponents';

const Navigation = (props) => {
	return (
		<NavContainer>
			<Nav>
				<Logo />
				<SubNavMenu>
					<SubNavMenuList>
						<SubNavMenuListItem active={props.page === "home"}>
							<a href="/home">Home</a>
						</SubNavMenuListItem>
						<SubNavMenuListItem active={props.page === "coffee"}>
							<a href="/coffee">Coffee</a>
						</SubNavMenuListItem>
						<SubNavMenuListItem active={props.page === "plant"}>
							<a href="/plant">Plant</a>
						</SubNavMenuListItem>
					</SubNavMenuList>
				</SubNavMenu>
			</Nav>
		</NavContainer>
	);
}

export default Navigation;
